(()=>{"use strict";(t=>{let e=document.getElementById("timer-hours"),n=document.getElementById("timer-minutes"),o=document.getElementById("timer-seconds"),m=t=>t<10?"0"+t:t,r=setInterval((()=>{let t=(()=>{let t=(new Date("28 october 2021").getTime()-(new Date).getTime())/1e3;return{timeRemaining:t,hours:Math.floor(t/60/60),minutes:Math.floor(t/60%60),seconds:Math.floor(t%60)}})();e.textContent=m(t.hours),n.textContent=m(t.minutes),o.textContent=m(t.seconds),t.timeRemaining<0&&(e.textContent=m(0),n.textContent=m(0),o.textContent=m(0),clearInterval(r))}),1e3)})()})();